import React from "react";
import { Container, Row, Col } from "react-bootstrap";
const CountDown = () => {
  return (
    <Container fluid style={{ padding: "0px 25px" }}>
      <Row
        style={{
          justifyContent: "space-between",
          padding: "15px 0px ",
          alignItems: "center",
        }}
      >
        <Col xs={4}>
          <h5>CountDown App</h5>
        </Col>
      </Row>

      <Container>sdsdfsd</Container>
    </Container>
  );
};

export default CountDown;
